	rgb(227,170,214)
	rgb(181,216,235)
	rgb(238,242,230)
	rgb(255,237,201)
	rgb(255,200,186)
	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
.github-StubItem-github,
.github-GitHub-root {
  flex: 1;
  display: flex;
}
.github-GitHub {
  flex: 1;
  min-width: 0;
  display: flex;
  flex-direction: column;
  -webkit-user-select: none;
  cursor: default;
}
.github-GitHub-content {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.github-GitHub-noRemotes,
.github-GitHub .github-RemoteSelector {
  flex: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;
  font-size: 1.25em;
  text-align: center;
  padding: 30px;
}
.github-GitHub-noRemotes > *,
.github-GitHub .github-RemoteSelector > * {
  margin: 10px 0;
}
.github-GitHub-noRemotes h1,
.github-GitHub .github-RemoteSelector h1 {
  margin-bottom: 30px;
}
.github-GitHub .github-RemoteSelector ul {
  list-style: none;
  padding-left: 0;
}
.github-GitHub .github-RemoteSelector ul li:not(:last-child) {
  margin-bottom: 10px;
}
.github-GitHub .github-RemoteSelector button {
  width: 100%;
  overflow: hidden;
  text-overflow: ellipsis;
}
.github-GitHub-LargeIcon:before {
  margin-right: 0;
  margin-bottom: 50px;
  width: auto;
  height: auto;
  font-size: 8em;
  color: #555759;
}
